const Searchbar = ({ fetchTeams, teams }) => {



  return (
    <section>
        <label for="searchLeague">Search league:</label>
        <input type="searchLeague" id="searchLeague" name="searchLeague"></input>
      {teams.map((team, i) => <div>{team.name}</div>)}
    </section>
  )
};

export default Searchbar;
